var esES={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Permitir","Allow in your wallet":"Permitir en su billetera","Allow {symbol} first":["Permitir ",["symbol"]," primero"],"Allowance pending":"Asignación pendiente","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Se produjo un error al intentar ejecutar este intercambio. Es posible que deba aumentar su tolerancia al deslizamiento. Si eso no funciona, puede haber una incompatibilidad con el token que está negociando. Nota: la tarifa de transferencia y los tokens de rebase son incompatibles con Uniswap V3.","Approval pending":"Aprobación pendiente","Approve":"Aprobar","Approve Permit2":"Approve Permit2","Approve in your wallet":"Aprueba en tu billetera","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Aprobar ",["symbol"]," primero"],"Auto":"Auto","Auto Router":"Enrutador automático","Auto Router API":"Auto Router API","Balance:":"Saldo:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Cerrar","Confirm in your wallet":"Confirma en tu billetera","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Conectar cartera","Connecting…":"Conectando…","Continue":"Continue","Convert {0} to {1}":["Convertir ",["0"]," a ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Desconectar billetera","Dismiss":"Descartar","Enter an amount":"Introduzca un monto","Error fetching trade":"Error al obtener comercio","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Buscando el mejor precio…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Un alto deslizamiento aumenta el riesgo de movimiento de precios","I don't have a wallet":"no tengo billetera","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Saldo ",["0"]," insuficiente"],"Invalid recipient":"Receptor no válido","Max":"Máx","Max slippage":"Deslizamiento máximo","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Dependencias faltantes","Network fee":"Tarifa de red","No results found.":"No se han encontrado resultados.","No tokens are available on this network. Please switch to another network.":"No hay tokens disponibles en esta red. Cambia a otra red.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Introduzca un porcentaje de deslizamiento válido","Powered by the Uniswap protocol":"Desarrollado por el protocolo Uniswap","Price impact":"Impacto en el precio","Price updated":"Precio actualizado","Reload":"Reload","Reload the page":"recargar la pagina","Request rejected":"Request rejected","Review swap":"Intercambio de opiniones","Search by token name or address":"Buscar por nombre de token o dirección","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Algo salió mal","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Éxito","Swap":"Intercambiar","Swap failed: {0}":["Error de intercambio: ",["0"]],"Switch network":"cambiar de red","Switch network in your wallet":"Cambie de red en su billetera","Switching network":"Red de conmutación","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"El invariante Uniswap x*y=k no estaba satisfecho con el intercambio. Esto generalmente significa que uno de los tokens que está intercambiando incorpora un comportamiento personalizado en la transferencia.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"El token de entrada no se puede transferir. Puede haber un problema con el token de entrada.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"El token de salida no se puede transferir. Puede haber un problema con el token de salida.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"El token de salida no se puede transferir. Puede haber un problema con el token de salida. Nota: la tarifa de transferencia y los tokens de rebase son incompatibles con Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Esta transacción no se realizará correctamente debido al movimiento de precios. Intente aumentar su tolerancia al deslizamiento. Nota: la tarifa de transferencia y los tokens de rebase son incompatibles con Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Esta transacción no se realizará correctamente debido al movimiento del precio o al cargo por transferencia. Intente aumentar su tolerancia al deslizamiento.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Fecha límite de la transacción","Transaction rejected":"Transacción rechazada","Transaction submitted":"Transacción enviada","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Intente aumentar su tolerancia al deslizamiento.<0/>NOTA: La tarifa de transferencia y los tokens de rebase son incompatibles con Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Error inesperado. No se pudo estimar el gas para el canje.","Unexpected issue with estimating the gas. Please try again.":"Problema inesperado con la estimación del gas. Inténtalo de nuevo.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Ver en Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Advertencia","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Su transacción se revertirá si ha estado pendiente durante más tiempo que este período de tiempo.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Su transacción se revertirá si el precio cambia desfavorablemente más de este porcentaje.","minutes":"minutos","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," tarifa"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

